import TaskItem from "./TaskItem";
import "./TaskList.css";

const TaskList = (props) => {
  const tasksList = props.tasks.map((todo) => todo.task);

  return (
    <div className="task-container">
      <div>
        {tasksList.map((task) => (
          <TaskItem todo={task} />
        ))}
      </div>
    </div>
  );
};

export default TaskList;
